import React, { useState } from 'react';

export default function (){

  function testSome(){
    fetch("https://bing-image-search1.p.rapidapi.com/images/trending", {
	"method": "GET",
	"headers": {
		"x-rapidapi-host": "bing-image-search1.p.rapidapi.com",
		"x-rapidapi-key": "434e8dd559msha6684ef3d707127p1e725djsn51a32c1f9fb4"
	}}).then(response => {
      console.log(response);
    })
    .catch(err => {
      console.log(err);
    });
  }

  return (
    <>
    <h1>Hello</h1>
    <button onClick={testSome}>CLICK</button>
    </>
  );
}
